// Filter Function
func Filter(vs []string, f func(string) bool) []string {
	vsf := make([]string, 0)
	for _, v := range vs {
		if f(v) {
			vsf = append(vsf, v)
		}
	}
	return vsf
}

// CaseInsensitiveHasPrefix: To Upper Function
func CaseInsenstiveHasPrefix(a, b string) bool {
	return strings.HasPrefix(strings.ToUpper(a), strings.ToUpper(b))
}
